ription with store number",\r\n    "transaction_type": "purchase",\r\n    "normalized_description": "Walmart - Retail Purchase",\r\n    "original_context": "Retail store purchase at Walmart #1234",\r\n    "questions": ""\r\n}	1	\N	\N	t	2025-04-12 01:46:39.518668+00	2025-04-12 01:46:39.526617+00
